import React from "react";
import { View, StyleSheet, Text } from "react-native";

const SignupScreen = () => {
  return (
    <View>
      <Text style={{ fontSize: 46 }}>SignupScreen</Text>
    </View>
  );
};

const styles = StyleSheet.create({});

export default SignupScreen;
